import React, { Component } from 'react';
class Card extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return <div class="card" draggable="true" ondragstart="drag(event)">
      <div class = "title">{this.props.name}</div>
      <div class="description">{this.props.description}</div>
    </div>
  }
}
export default Card;
